INSERT INTO post VALUES(31,'Flask',replace(replace('<p>大部分程序都需要保存数据，所以不可避免要使用数据库。用来操作数据库的数据库管理系统（DBMS）有很多选择，对于不同类型的程序，不同的使用场景，都会有不同的选择。在这个教程中，我们选择了属于关系型数据库管理系统（RDBMS）的 <a href="https://www.sqlite.org/" rel="noopener noreferrer" target="_blank">SQLite</a>，它基于文件，不需要单独启动数据库服务器，适合在开发时使用，或是在数据库操作简单、访问量低的程序中使用。</p>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<p>使用 SQLAlchemy 操作数据库</p>\r\n\r\n<p>为了简化数据库操作，我们将使用 <a href="https://www.sqlalchemy.org/" rel="noopener noreferrer" target="_blank">SQLAlchemy</a>&mdash;&mdash;一个 Python 数据库工具（ORM，即对象关系映射）。借助 SQLAlchemy，你可以通过定义 Python 类来表示数据库里的一张表（类属性表示表中的字段 / 列），通过对这个类进行各种操作来代替写 SQL 语句。这个类我们称之为<strong>模型类</strong>，类中的属性我们将称之为<strong>字段</strong>。</p>\r\n\r\n<p>Flask 有大量的第三方扩展，这些扩展可以简化和第三方库的集成工作。我们下面将使用一个叫做 <a href="http://flask-sqlalchemy.pocoo.org/2.3/" rel="noopener noreferrer" target="_blank">Flask-SQLAlchemy</a> 的官方扩展来集成 SQLAlchemy。</p>\r\n','\r',char(13)),'\n',char(10)),'2021-01-25 10:59:40.359014',1,NULL);
