PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE category (
	id INTEGER NOT NULL, 
	name VARCHAR(30), 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE admin (
	id INTEGER NOT NULL, 
	username VARCHAR(20), 
	password_hash VARCHAR(128), 
	PRIMARY KEY (id), 
	UNIQUE (username)
);
CREATE TABLE post (
	id INTEGER NOT NULL, 
	title VARCHAR(60), 
	body TEXT, 
	timestamp DATETIME, 
	category_id INTEGER, 
	user_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(category_id) REFERENCES category (id), 
	FOREIGN KEY(user_id) REFERENCES admin (id)
);
CREATE INDEX ix_post_timestamp ON post (timestamp);
COMMIT;
